import React from "react";
import { SwapiServiceC } from "../SwapiServiceContext";

const WithSwapi = Wrapped => {
  return props => {
    return (
      <SwapiServiceC>
        {swapiService => {
          return <Wrapped {...props} swapiService={swapiService}></Wrapped>;
        }}
      </SwapiServiceC>
    );
  };
};
export {WithSwapi};
